INSERT INTO `media` VALUES ('1', '1', '1', 'El Premio de la Paz mundial: Â¿QuiÃ©n recibirÃ¡ los 100 millones de Zeni?', 'Han pasado seis meses desde que GokÃº derrotÃ³ a Buu, y ya con la paz restaurada, GokÃº cumple su promesa a su esposa Milk, de trabajar y ganar dinero como granjero. Por su parte, Gohan y Videl preparan su boda, por lo que Goten y Trunks preparan conjunta', 'chapter', 'jp/spa', '2017-11-08 03:48:18', '2017-11-08 03:48:18'), ('2', '1', '2', 'Â¡Al Prometido DÃ­a de Vacaciones! Â¿Â¡Vegeta va de excursiÃ³n familiar!?', 'GokÃº llega al planeta de KaiÅsama donde comienza un arduo entrenamiento, ya que en ese planeta la gravedad es 10 veces mayor que el de la tierra. Vegeta le cumple a Trunks la promesa que le hizo hace un tiempo de llevarlo al parque de atracciones (Ep. 2', 'chapter', 'jp/spa', '2017-11-08 05:29:41', '2017-11-08 05:29:41'), ('3', '1', '3', 'Â¿Y la continuaciÃ³n del sueÃ±o? Â¡La BÃºsqueda del Dios SÃºper Saiyajin!', 'RÅ KaiÅ Shin reconoce el peligro que puede causar Bills, temiendo que GokÃº llegue a enfrentarlo a una pelea. Bills no puede recordar el nombre del guerrero que apareciÃ³ en su sueÃ±o premonitorio, por lo que decide preguntarle al Pez OrÃ¡culo. Este dic', 'chapter', 'jp/spa', '2017-11-08 05:37:12', '2017-11-08 05:37:12'), ('4', '1', '4', 'Â¡Vayamos por las Dragon Balls! Â¡La gran estrategia de la banda de Pilaf!', 'KaiÅsama intenta ocultarle a GokÃº la existencia de Bills, mientras que GokÃº todavÃ­a continÃºa entrenando. Trunks y Goten husmean por el barco y llegan a la sala de premios, para ver el premio especial del Bingo de Bulma, siendo las Dragon Balls. La Ba', 'chapter', 'jp/spa', '2017-11-08 05:38:14', '2017-11-08 05:38:14'), ('5', '1', '5', 'Â¡Batalla decisiva en el planeta Kaio! GokÃº vs Bills, el Dios de la DestrucciÃ³n!', 'KaiÅsama ha ocultado a GokÃº en su casa derrumbada, e intenta distraer a Bills de la presencia de GokÃº, Wiss ademÃ¡s les recuerda que llevaban 327 aÃ±os sin verse uno del otro. Sin embargo, Bills ya sabÃ­a de la presencia de GokÃº afirmando que es la ra', 'chapter', 'jp/spa', '2017-11-08 05:39:21', '2017-11-08 05:39:21'), ('6', '1', '6', 'No hagan enojar al Dios de la destrucciÃ³n! La emocionante fiesta de cumpleaÃ±os.', 'KaiÅsama advierte a Vegeta de lo sucedido, mientras que GokÃº intenta volverse mÃ¡s fuerte, aunque Bills ya ha llegado al barco de lujo de Bulma. Vegeta se encuentra con el dios de la destrucciÃ³n cayendo a sus pies recordando a su padre el Rey Vegeta, s', 'chapter', 'jp/spa', '2017-11-08 05:40:28', '2017-11-08 05:40:28'), ('7', '1', '7', 'Â¡Nadie toca a mi Bulma! Â¡La ira de Vegeta estalla!', 'Bills atacÃ³ a Majin Buu ante la presencia de todos, quienes no conocen que su verdadera identidad es la del dios de la destrucciÃ³n. Vegeta intenta calmarlo, pero este se enfurece mÃ¡s y planea destruir el planeta, Majin Buu vuelve del ocÃ©ano para venga', 'chapter', 'jp/spa', '2017-11-08 05:41:48', '2017-11-08 05:41:48'), ('8', '1', '8', 'Â¡GokÃº aparece! Â¿La Ãºltima oportunidad que darÃ¡ Bills?', 'Vegeta pierde el control al ver que Bills golpeÃ³ a Bulma y lo ataca con su mÃ¡ximo poder. Sin embargo, Bills con solo el uno por ciento de su poder derrota a Vegeta. Bills decide destruir la tierra, pero como la comida de la tierra es mejor que en otros ', 'chapter', 'jp/spa', '2017-11-08 06:03:02', '2017-11-08 06:03:02'), ('9', '1', '9', 'Â¡Al fin lleguÃ©, Bills! Â¡Al fin el Dios SÃºper Saiyajin nace!', 'GokÃº llama a Sheng Long con las Dragon Balls y le pide que traiga al SÃºper Saiyajin fase Dios, pero Shen Long le explica que se necesita la energÃ­a de cinco Super Saiyajines de corazÃ³n puro, para transferÃ­rselos a un sexto Saiyajin. Por lo que Vegeta', 'chapter', 'jp/spa', '2017-11-08 06:05:57', '2017-11-08 06:05:57'), ('10', '1', '10', 'Â¡MuÃ©stralo, GokÃº! El poder del SÃºper Saiyajin fase Dios!', 'Comienza la pelea entre dioses, con ventaja para Bills, ya que GokÃº aÃºn no domina el poder del SÃºper Saiyajin fase Dios. Mientras los g